  }

  @media (max-width: 439px){
    .leagueItem-page {
      .gameItemOuter {
        height: 180px;
      }
      .cardOuter {
        width: 100%;
        margin: 0;
      }
        .cardItem {
        width: 310px;
        width: inherit;
        height: 180px;

        .awayScore {
          right: auto;
          left: 0;
          top: 90px;
      }

        .homeTeamInfoDiv {
          width: calc((100% - 150px));
          left: 100px;

          .cityRec {
            text-align: left;
          }
          .teamName {
            text-align: center;
          }
        }
        .middle {
          top: 72.5px;
          transform: rotate(90deg);
          -webkit-transform: rotate(90deg);
          -moz-transform: rotate(90deg);
          z-index: 3;
          left: auto;
          right: -45px;
        }
        .gameTime {
          left: 100px;
          width: calc((100% - 150px));
          text-align: center;
          bottom: 82px;
          font-weight: 900;
        }
        .awayTeamInfoDiv {
          top: auto;
          bottom: 15px;
          width: calc((100% - 150px));
          left: 100px;
          text-align: right;

          .cityRec {
            text-align: left;
          }
          .teamName {
            text-align: center;
          }

        }
        .awayTeamLogoDiv {
          right: auto;
          background: -webkit-gradient(linear, right top, left top, from(#141414), color-stop(0.15, #1d1d1d), to(#202020));
          width: 90px;
          height: 90px;
          position: absolute;
          top: 90px;
          left: 0;
        }
        .awayTeamLogoWrapper {
          top: 90px;
          right: auto;
          left: 0;
        }
      }
    }
  }

  @media (max-width: 500px) {
    .leagueItem-page .cardItem .awayTeamInfoDiv .teamName, .leagueItem-page .cardItem .homeTeamInfoDiv .teamName {
      font-size: 20px;
    }
    .leagueItem-page .cardItem .awayTeamInfoDiv .cityRec, .leagueItem-page .cardItem .homeTeamInfoDiv .cityRec {
      font-size: 10px;
    }
    .leagueItem-page .maxHeight90 {
      max-height: none;
    }
  }

  @media (max-width: 663px) and (min-width: 440px){
    .leagueItem-page {
      .maxHeight90 {
        max-height: none;
      }
      .gameItemOuter, .userPickItemOuter {
        height: 140px;
      }
      .cardOuter {
        width: 100%;
        margin: 0;
      }
        .cardItem {
        width: 310px;
        width: inherit;
        height: 140px;

        .awayTeamInfoDiv {
          left: auto;
          right: 100px;

          .cityRec, .teamName {
            text-align: right;
          }
        }
        .homeTeamInfoDiv {
          left: 100px;

          .cityRec, .teamName {
            text-align: left;
          }
        }
        .score {
          padding-top: 46px;
        }
        .homeTeamLogoWrapper, .awayTeamLogoWrapper {
          background-position-y: 25px !important;
        }

        .score, .homeTeamLogoDiv, .homeTeamLogoWrapper, .awayTeamLogoDiv, .awayTeamLogoWrapper  {
          height: 140px;
        }

        .middle {
          top: 72.5px;
          z-index: 3;
        }
        .gameTime {
          bottom: auto;
          top: 120px;
        }
        .middle, .gameTime {
          left: calc((50% - 72.5px));
        }
        .score, .homeTeamLogoDiv, .homeTeamLogoWrapper, .awayTeamLogoDiv, .awayTeamLogoWrapper  {
          height: 140px;
        }
      }
    }
  }

  @media (max-width: 1199px) and (min-width: 992px) {
    .leagueItem-page .cardItem {
      width: 584.66px;

       .homeTeamInfoDiv {
        width: 115.83px;
       }
       .awayTeamInfoDiv {
        width: 115.83px;
        left: 378.83px;
       }
       .middle, .gameTime {
        left: 219.83px;
       }
       .awayTeamInfoDiv .teamName, .homeTeamInfoDiv .teamName {
        font-size: 22px;
       }
    }
  }

