      font-size: 40px;
    }
  }
}
@media (min-width: 992px) {
  .bbBannerAd {
    width: 100%;
    height: 90px;
    padding: 20px;

    .company {
      font-size: 50px;
      margin-right: 10px;
    }
  }
}
@media (min-width: 1200px) {
  .bbBannerAd {
    margin-right: 20px;
    width: calc((100% - 20px));
  }
}

